import { Box, Heading } from "@chakra-ui/react";
import Pic from "../pic/pic.component";

export default function Pics(props) {
  const { title } = props;

  const items = [1];

  return (
    <Box p={2} maxW="sm">
      <Heading color="gray.500" pb={3}>
        {title}
      </Heading>
      {items.map((item) => {
        return <Pic numero={item} />;
      })}
    </Box>
  );
}
